function HeroComponent() {
  return (
    <div className="hero-section">
            <h1>Contact Us</h1>
            <h3>Get In touch!</h3>
            <p>
        Have questions, feedback, or want to collaborate with us? We’d love to hear from you! Reach out to our team and we’ll get back to you as soon as possible. Your input helps us grow and serve the neuroscience community better.
      </p>
    </div>
  );
}

export default HeroComponent;
